import React, { Component } from 'react'
import AllPosts from './AllPosts';
import {Link} from 'react-router-dom';

export default class ShareCorner extends Component {
    render() {
        return (
            <div className="allPosts">
                <AllPosts {...this.props}/>
            </div>
        )
    }
}
